import {  MDBNavbar,MDBContainer,MDBRow, MDBCol, MDBCard, MDBCardBody, MDBMask, MDBIcon, MDBView, MDBBtn } from "mdbreact";
import React, { Component,Fragment } from "react";
import ReactDOM from "react-dom";
import '@fortawesome/fontawesome-free/css/all.min.css';
import "bootstrap-css-only/css/bootstrap.min.css";
import "mdbreact/dist/css/mdb.css";
import Navbar from "./containers/Navbar.js";
import MostVisited from "./containers/MostVisited.js";
import { BrowserRouter } from 'react-router-dom';
import MainLayout from "./containers/MainLayout.js";

const App = () => {
  return (
    <BrowserRouter>
        <Fragment>

            <Navbar/>
            <MostVisited/>
            <MainLayout/>
        </Fragment>

    </BrowserRouter>
  );
}

export default App;
